export const initialState = {
    req:"0",
    title:"누상동 다목적 운동장",
    lat: "37.5795876",
    lng: "126.9636324",
    address:"서울특별시 종로구 누상동 1-3",
    time:"상시개방",
    light:"N",
    special:["플라스틱 인도어구장", "화장실"],
    description:"인왕산 초입에 있는 풋살 구장입니다. 골대와 바닥, 펜스가 최근에 교체하여 깔끔합니다.",
    picture:[],
    comment:[],
}

export const SELECT_STADUIM =  'SELECT_STADUIM';
// export const GET_STADIUM_LIST = 'GET_STADIUM_LIST';

export const selectStadiumAction = (data) => {
    return {
        type: SELECT_STADUIM,
        data,
    };
}

export default (state = initialState, action) => {
    switch (action.type) {
        case SELECT_STADUIM: {
            return {
                req:action.data.req,
                ...initialState,
            }
        }
        default: {
            return {
                ...state,
            }
        }
    }
}
